import styled from 'styled-components';
import Bubble from '../../../../bubble/Bubble';

const Bubbles = styled.div`
    background: white;
    display:flex;
    min-height: 300px;
`;

const Welcome = () => {
    return(
        <Bubbles>
            <Bubble title="computers" src="https://img.icons8.com/office/80/000000/computer.png" target="amazon.com"/>
            <Bubble title="computers" src="https://img.icons8.com/office/80/000000/computer.png" target="amazon.com"/>
            <Bubble title="computers" src="https://img.icons8.com/office/80/000000/computer.png" target="amazon.com"/>
            <Bubble title="computers" src="https://img.icons8.com/office/80/000000/computer.png" target="amazon.com"/>
            <Bubble title="computers" src="https://img.icons8.com/office/80/000000/computer.png" target="amazon.com"/>
        
        </Bubbles>
    )
}

export default Welcome;
